        public static int[,] GetMatixArray()
        {

            var reelsSet = SoftwareRng.Next(48);
            var mat = new int[5, 5];
            for (var i = 0; i < 5; i++)
            {
                var l = _Reels[reelsSet][i].Length;
                var p = SoftwareRng.Next(l);
                for (var j = 0; j < 5; j++)
                {
                    mat[i, j] = _Reels[reelsSet][i][(p + j) % l];
                }
            }
            return mat;
        }

        public int GetDiamondCount(int[,] matrixArray)
        {
            int diamondCount = 0;
            for (var i = 1; i < 4; i++)
            {
                for (var j = 1; j < 4; j++)
                {
                    if (matrixArray[i, j] == 0)
                    {
                        diamondCount++;
                    }
                }
            }
            return diamondCount;
        }

        public bool ShouldRepeatCalculation(int diamondCount)
        {
            if (SoftwareRng.Next() < RepeatFactor || diamondCount > 2)
            {
                return false;
            }
            return true;
        }

        public static int[] GetDiamondMaskArray()
        {
            var maskSet = -1;
            var sum = 0.0;
            var rnd = SoftwareRng.Next();
            var n = _DiamondProbs.Length;
            for (var i = 0; i < n; i++)
            {
                sum += _DiamondProbs[i];
                if (rnd < sum)
                {
                    maskSet = i;
                    break;
                }
            }
            return _DiamondMaskArrays[maskSet];
        }

        public static bool AreAllMasksEqual(int[] diamondMaskArray)
        {
            return diamondMaskArray[0] == diamondMaskArray[1] && diamondMaskArray[0] == diamondMaskArray[2];
        }

        public static int GetDiamondPairId(byte[,] matrix, int[] diamondMaskArray)
        {
            var count1 = 0;
            var count2 = 0;
            for (var i = 1; i < 4; i++)
            {
                for (var j = 1; j < 4; j++)
                {
                    if (matrix[i, j] == diamondMaskArray[0])
                    {
                        count1++;
                    }
                    if (matrix[i, j] == diamondMaskArray[1])
                    {
                        count2++;
                    }
                }
            }
            if (count1 == 2)
            {
                return diamondMaskArray[0];
            }
            if (count2 == 2)
            {
                return diamondMaskArray[2];
            }
            return -1;
        }


        /// <summary>
        /// Računa dobitak linije.
        /// </summary>
        /// <param name="lineNumber"></param>
        /// <returns></returns>
        public override int CalculateWinLine(int lineNumber)
        {
            return GetLine(lineNumber, UnicornGlobalData.GameLineShifted).CalculateLineWin(WinForLinesTopPrizeWilds, null, 0, 1);
        }

        /// <summary>
        /// Konstruiše matricu na osnovu dvodimenzionalnog niza.
        /// </summary>
        /// <param name="matrix"></param>
        public void FromMatrixArrayTopPrizeWilds(int[,] matrix)
        {
            for (var i = 0; i < 5; i++)
            {
                for (var j = 0; j < 5; j++)
                {
                    SetElement(i, j, matrix[i, j]);
                }
            }
        }
        /// <summary>
        /// Vraća niz koeficijenata za id simbola.
        /// </summary>
        /// <param name="id"></param>
        /// <returns></returns>
        public static int[] GetSymbolCoefficients(int id)
        {
            var coefficients = new int[5];

            for (var i = 0; i < 5; i++)
            {
                coefficients[i] = WinForLinesTopPrizeWilds[id, i];
            }
            return coefficients;
        }

        public static HelpConfigV3<object> GetHelpConfigV3()
        {
            var helpV3 = new HelpConfigV3<object>
            {
                rtp = (decimal?)96.0,
                symbols = GetHelpSymbolConfigV3(),
                lines = GetHelpLineConfigV3()
            };

            return helpV3;
        }

        /// <summary>
        /// Returns symbols configuration.
        /// </summary>
        /// <returns></returns>
        private static HelpSymbolConfigV3<object>[] GetHelpSymbolConfigV3()
        {
            var symbols = new HelpSymbolConfigV3<object>[8];

            for (var i = 0; i < 7; i++)
            {
                symbols[i] = new HelpSymbolConfigV3<object>
                {
                    id = i,
                    features = new[] { HelpSymbolFeatureV3.Regular },
                    extra = new HelpSymbolExtraV3(),
                    coefficients = GetSymbolCoefficients(i)
                };
            }
            return symbols;
        }

        private static HelpLineConfigV3[] GetHelpLineConfigV3()
        {
            var lines = new HelpLineConfigV3[10];
            for (var i = 0; i < 10; i++)
            {
                var pos = new int[5];
                for (var j = 0; j < 5; j++)
                {
                    pos[j] = UnicornGlobalData.GameLineShifted[i, j] - 1;
                }
                lines[i] = new HelpLineConfigV3 { id = i, positions = pos };
            }

            return lines;
        }
    }

